import React from 'react';

export default () => (
    <style jsx global>
       {`
            body{
                margin: 0;
                padding: 0;
            }

            .flex {display: flex;}
            .flex-center {
                justify-content: center;
                align-items: center;
            }

             .Header {
                 max-height:100px;
             }
             .header-wrapper {
                 max-width:1200px;
                 margin: 0 auto;
                 width:100%;
             }
       `} 
    </style>
)
